import { Button, Container, Grid, TextField } from "@mui/material";
import React from "react";

export default function SearchPanel() {
  return (
    <>
      <Grid container padding={2}>
        <Grid sm={6}></Grid>
        <Grid sm={6}></Grid>
      </Grid>
      <TextField
        id="search_content"
        label="Search categories"
        variant="outlined"
      />
      <Button variant="contained">Search</Button>
    </>
  );
}
